import React from "react";
import { BrowserRouter as Router, Route,  } from "react-router-dom";
import AboutUs from "./components/AboutUs/AboutUs";
import Home from "./Home";
function App() {
  return (
    <Router>
      <Routes>
        <Route exact path="/">
          <Home />
        </Route>
        <Route exact path="/AboutUs">
          <AboutUs />
        </Route>
      </Routes>
    </Router>
  );
}

export default App;
